    useEffect(() => {
        // props.setNftDataThunk();
        fetch('http://localhost:8000/Products', {
            mode: 'no-cors'
       })
            .then(response => response.json())
            .then(data => {
                console.log(data)
                // dispatch(setNftData(data))
                // dispatch(isFetchingCreactor(false))
            })
    })

    return (
        <ProductList nft={props.nft} />
    )
}

const mapStateToProps = (state) => {
    return {
        nft: state.productPage.nft
    }
}

export default connect(mapStateToProps, {setNftDataThunk})(ProductListContainer);
